import React, { Component } from 'react';
import { Navbar } from '../../home/component/index';
import { SideNav } from '../components';

export default class HomePage extends Component {
  state = {};

  render() {
    return (
      <div>
        <Navbar />
        <div style={{ display: 'flex' }}>
          <SideNav />
        </div>
      </div>
    );
  }
}
